  false,\n\t\"url\": null,\n\t\"notes\": \"The Arctic Coastal Plain of northern Alaska
  is an area of strategic economic importance to the United States, is home to remote
  Native American communities, and encompasses unique habitats of global significance.
  Coastal erosion along the north coast of Alaska is chronic, widespread, may be accelerating,
  and is threatening defense and energy-related infrastructure, natural shoreline
  habitats, and Native communities. There is an increased demand for accurate information
  regarding past and present shoreline changes across the United States. To meet these
  national needs, the Coastal and Marine Geology Program of the U.S. Geological Survey
  (USGS) is compiling existing reliable historical shoreline data along sandy shores
  of the conterminous United States and parts of Alaska and Hawaii under the National
  Assessment of Shoreline Change project. There is no widely accepted standard for
  analyzing shoreline change. Existing shoreline data measurements and rate calculation
  methods vary from study to study and prevent combining results into state-wide or
  regional assessments. The impetus behind the National Assessment project was to
  develop a standardized method of measuring changes in shoreline position that is
  consistent from coast to coast. The goal was to facilitate the process of periodically
  and systematically updating the results in an internally consistent manner.\",\n\t\"license_title\":
